import "../Css-files/home.css"

export default function Home() {
  return (

<div>  
<h1 class="titleHeader">Inventa</h1>
          <h2 className="subHeader">Helping you find people, companies, and more</h2>
          <div className="topnav">
            <input id="searchField" className="searchContainer" type="text" placeholder="Type any information...."></input>
            <button id="findButton" className="searchButton" type="button">Find</button>
          </div>
          <div id="result" className="returnedResult"></div>
</div> 




  );
}
